script: |
  super -f text -I q838.spq | sort > q838.out

inputs:
  - name: q838.spq
    data: |
      SELECT - - 48 AS col2 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN - 76 * - col1 * - + ( - col0 ) AND - - col1 + col0 + + col1 * - + col0;
  - name: tab1

outputs:
  - name: q838.out
    data: |
